con:config.script:
import com.eviware.soapui.model.testsuite.TestRunner.Status

def tc=testRunner.testCase.testSuite.project.testSuites["TestSuite1"].testCases["Property And Property Transfer"]
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context);
def testCase = testRunner.testCase
def testRunner = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestCaseRunner(testCase, null);

def saveCustomer = tc.testSteps["Save Customer"]
def saveCustomerRequestHolder = groovyUtils.getXmlHolder(saveCustomer.getPropertyValue("Request"));
saveCustomerRequestHolder.setNodeValue("//*:email", tc.testSteps["Properties"].getPropertyValue("email"))
saveCustomerRequestHolder.setNodeValue("//*:firstname", tc.testSteps["Properties"].getPropertyValue("firstname"))
saveCustomerRequestHolder.setNodeValue("//*:lastname", tc.testSteps["Properties"].getPropertyValue("lastname"))
//log.info saveCustomer.getPropertyValue("Request")
testStepContext = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext(saveCustomer);
def runner = saveCustomer.run(testRunner, testStepContext);
//log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info saveCustomer.getPropertyValue("Response")
def saveCustomerResponseHolder = groovyUtils.getXmlHolder(saveCustomer.getPropertyValue("Response"));
def saveCustomerId = saveCustomerResponseHolder.getNodeValue("//*:id")
log.info "saveCustomerId "+saveCustomerId

def getCustomer = tc.testSteps["Get Customer"]
def getCustomerRequestHolder = groovyUtils.getXmlHolder(saveCustomer.getPropertyValue("Request"))
getCustomerRequestHolder.setNodeValue("//*:customerId", saveCustomerId)
//log.info getCustomer.getPropertyValue("Request")
testStepContext = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext(getCustomer);
runner = getCustomer.run(testRunner, testStepContext);
//log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info getCustomer.getPropertyValue("Response")
def getCustomerResponseHolder = groovyUtils.getXmlHolder(getCustomer.getPropertyValue("Response"));
def getCustomerId = saveCustomerResponseHolder.getNodeValue("//*:id")
log.info "getCustomerId "+getCustomerId

def deleteCustomer = tc.testSteps["Delete Customer"]
def deleteCustomerRequestHolder = groovyUtils.getXmlHolder(deleteCustomer.getPropertyValue("Request"))
deleteCustomerRequestHolder.setNodeValue("//*:customerId", getCustomerId)
//log.info deleteCustomer.getPropertyValue("Request")
testStepContext = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext(deleteCustomer);
runner = deleteCustomer.run(testRunner, testStepContext);
//log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info deleteCustomer.getPropertyValue("Response")
def deleteCustomerResponseHolder = groovyUtils.getXmlHolder(deleteCustomer.getPropertyValue("Response"));
def deleteCustomerId = saveCustomerResponseHolder.getNodeValue("//*:id")
log.info "deleteCustomerId "+deleteCustomerId

con:testCase.con:tearDownScript:
//Get and list step results
listStepResults = testRunner.getResults()
for (res in listStepResults){
 log.info(res.getTestStep().getName() + " : " + res.getStatus()) 
}

